import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

 const name = "rajendra";
  const img2 = "https://picsum.photos/200/300/?blur=2";
  const img1 = "https://picsum.photos/seed/picsum/200/300"; 
  const img3 = "https://picsum.photos/id/870/200/300?grayscale&blur=2";
  const link1 = "http://github.com/shrivastav1811";
ReactDOM.render(
  <>
  <h1 className="heading"> My Name is {name} </h1>
  <div id="img"> 
  <img src={img1} alt="random image" />
  <img src={img2} alt="random image" />
  <img src={img3} alt="random image" /> <br />
  <a href={link1} target="_blank"> Click On me </a>
  </div>
  </>,
  document.getElementById('root')
);
